import React from "react";
import SearchBar from './SearchBar';
import { Link } from "react-router-dom";
import { Navigate } from "../../styles/styled-components"; 

export default function Nav(props){
    return (
        <Navigate>
            <SearchBar onSearch={props.onSearch}/>
            Linked
        </Navigate>
    )
}
